\documentclass{IM}
\usepackage{tikz}
\begin{document}

\def\unitLength{0.25in}

% Command to draw angle labels
\newcommand{\angleLabel}[6][0.4in]{%[labelDistance]{center}{startAngle}{endAngle}{positionRatio}{label}
     \centerarc[line width=0.5pt]#2(#3:#4:0.25in);
     \pgfmathsetmacro{\labelAngle}{#5*(#3)+(1-#5)*(#4)}; 
     \node at ($#2+(\labelAngle:#1)$) {#6};
}

\begin{tikzpicture}[x=\unitLength,y=\unitLength]

% Triangle params
\def\AngleP{45}
\def\AngleQ{67}
\def\baseLen{6}     % base length between P and Q

% Third angle R is computed from the other two
\pgfmathsetmacro{\AngleR}{int(180-\AngleP-\AngleQ)}

\coordinate (P) at (0,0);
\coordinate (Q) at (\baseLen,0);

% Find vertex R using intersection of rays from P and Q
\path [name path=RayP, overlay] (P) -- (\AngleP:40);
\path [name path=RayQ, overlay] ++(Q) -- +(180-\AngleQ:40);
\path [name intersections={of=RayP and RayQ}]
(intersection-1) coordinate (R);

% Draw Triangle PQR
\draw (P) -- (R) -- (Q) -- cycle;

% Vertex labels
\node[vertex,label=225:$P$] at (P) {};
\node[vertex,label=315:$Q$] at (Q) {};
\node[vertex,label=90:$R$] at (R) {};

% Angle labels
\angleLabel[0.4in]{(P)}{0}{\AngleP}{0.5}{$45^\circ$}
\angleLabel[0.4in]{(Q)}{180}{180-\AngleQ}{0.5}{$67^\circ$}

\end{tikzpicture}
\end{document}

